import { SAVE_TODO } from "../common/types";

export const loadList = ({ input }) => async (dispatch: any) => {
  try {
    dispatch({
      type: SAVE_TODO,
      payload: [
        {
          id: 0,
          name: input,
          checked: false,
        },
      ],
    });
  } catch (err) {
    console.log(`err`, err);
  }
};
